// src/pages/UserProfile.js
import React, { useEffect, useState } from 'react';
import './css/UserProfile.css'; // Ensure you have the CSS file in the same directory or update the path

const UserProfile = () => {
  // State to store user information
  const [userInfo, setUserInfo] = useState({
    name: 'John Doe',
    email: 'john.doe@example.com',
    phone: '123-456-7890',
  });

  // Fetch user information from localStorage on component mount
  useEffect(() => {
    const storedName = localStorage.getItem('username') || 'John Doe';
    const storedEmail = localStorage.getItem('email') || 'john.doe@example.com';
    const storedPhone = localStorage.getItem('phone') || '123-456-7890';

    setUserInfo({
      name: storedName,
      email: storedEmail,
      phone: storedPhone,
    });
  }, []);

  // Handle logout functionality
  const handleLogout = (event) => {
    event.preventDefault();
    localStorage.removeItem('loggedIn');
    window.location.href = '/login'; // Use relative paths or routes in React
  };

  return (
    <div>
      <header>
        <div className="container">
          <a href="/index" className="logo">LearnLinguaAI</a>
          <nav>
            <ul>
              <li><a href="/index">Home</a></li>
              <li><a href="/study">Exercises</a></li>
              <li><a href="/about">About</a></li>
              <li className="dropdown">
                <a href="#" className="dropbtn">More</a>
                <div className="dropdown-content">
                  <a href="/user-profile">Profile</a>
                  <a href="/contact">Contact</a>
                  <a href="#" onClick={handleLogout} id="logout-link">Logout</a>
                </div>
              </li>
            </ul>
          </nav>
        </div>
      </header>

      <section id="user-profile">
        <div className="container">
          <h2>Thông tin cá nhân</h2>
          <div className="profile-info">
            <p><strong>Tên:</strong> <span>{userInfo.name}</span></p>
            <p><strong>Email:</strong> <span>{userInfo.email}</span></p>
            <p><strong>Số điện thoại:</strong> <span>{userInfo.phone}</span></p>
          </div>
          <div className="profile-actions">
            <a href="/edit-profile" className="btn-secondary">Chỉnh sửa thông tin</a>
            <a href="/change-password" className="btn-secondary">Thay đổi mật khẩu</a>
          </div>
        </div>
      </section>

      <footer>
        <div className="container">
          <p>&copy; 2024 LearnLinguaAI. All Rights Reserved.</p>
        </div>
      </footer>
    </div>
  );
};

export default UserProfile;
